    sigma_KLCD_aaaa -= 1/2 * einsum('KxDy,LCyz,xz->KLCD', X_aaaa, v_xeaa, rdm_ca, optimize = einsum_type)
    sigma_KLCD_aaaa += 1/2 * einsum('KxDy,LCzx,yz->KLCD', X_aaaa, v_xeaa, rdm_ca, optimize = einsum_type)
    sigma_KLCD_aaaa -= 1/2 * einsum('KxDy,LxzC,yz->KLCD', X_aaaa, v_xaae, rdm_ca, optimize = einsum_type)
