    sigma_KLCD_aaaa += 1/2 * einsum('Kxay,LDaC,xy->KLCD', X_aaaa, v_xeee, rdm_ca, optimize = einsum_type)
    sigma_KLCD_aaaa -= 1/2 * einsum('LxCy,KDyz,xz->KLCD', X_aaaa, v_xeaa, rdm_ca, optimize = einsum_type)
