    sigma_KLCD_aaaa += 1/2 * einsum('KxCy,D,LyDz,xz->KLCD', X_aaaa, e_extern, t1_xaea, rdm_ca, optimize = einsum_type)
    sigma_KLCD_aaaa -= 1/2 * einsum('KxCy,D,LyzD,xz->KLCD', X_aaaa, e_extern, t1_xaae, rdm_ca, optimize = einsum_type)
