# CAAA <- CAEA
def compute_sigma_vector__H1__h1_h1__CAAA_CAEA(mr_adc, X_aaaa, X_abab, X_baab, X_abba, X_baba, X_bbbb, sigma):
    cput1 = (logger.process_clock(), logger.perf_counter())

    # Einsum definition from kernel
    einsum = mr_adc.interface.einsum
    einsum_type = mr_adc.interface.einsum_type

    #Dimensions
    caaa__aaaa = mr_adc.h1.caaa__aaaa
    caaa__abab = mr_adc.h1.caaa__abab
    caaa__baba = mr_adc.h1.caaa__baba
    caaa__bbbb = mr_adc.h1.caaa__bbbb

    ## Indices
    aa_tril_ind = mr_adc.h1.aa_tril_ind 

    ## Molecular Orbitals Energies
    e_extern = mr_adc.mo_energy.e

    ## One-electron integrals
    h_aa = mr_adc.h1eff.aa
    h_ae = mr_adc.h1eff.ae

    ## Two-electron integrals
    v_aaae = mr_adc.v2e.aaae
    v_xaex = mr_adc.v2e.xaex
    v_xxae = mr_adc.v2e.xxae 
    v_aaaa = mr_adc.v2e.aaaa

    ## Amplitudes
    t1_ae = mr_adc.t1.ae 
    t1_aaae = mr_adc.t1.aaae

    # Reduced Density Matrices
    rdm_ca = mr_adc.rdm.ca
    rdm_ccaa = mr_adc.rdm.ccaa
    rdm_cccaaa = mr_adc.rdm.cccaaa
    rdm_ccccaaaa = mr_adc.rdm.ccccaaaa

    sigma_KWUV_aaaa =- 1/2 * einsum('KxaU,Va,Wx->KWUV', X_aaaa, h_ae, rdm_ca, optimize = einsum_type)
    sigma_KWUV_aaaa += 1/2 * einsum('KxaV,Ua,Wx->KWUV', X_aaaa, h_ae, rdm_ca, optimize = einsum_type)
    sigma_KWUV_aaaa += 1/6 * einsum('Kxay,Ua,VxWy->KWUV', X_aaaa, h_ae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/6 * einsum('Kxay,Ua,VxyW->KWUV', X_aaaa, h_ae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/6 * einsum('Kxay,Va,UxWy->KWUV', X_aaaa, h_ae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa += 1/6 * einsum('Kxay,Va,UxyW->KWUV', X_aaaa, h_ae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa += 1/6 * einsum('KxaU,Vyza,Wzxy->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
