    sigma_KWUV_aaaa += 1/6 * einsum('KxaU,yWza,Vxyz->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/6 * einsum('KxaU,yWza,Vxzy->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/2 * einsum('KxaU,yzVa,Wyxz->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/6 * einsum('KxaV,Uyza,Wzxy->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa += 1/6 * einsum('KxaV,Uyza,Wzyx->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
    sigma_KWUV_aaaa -= 1/6 * einsum('KxaV,yWza,Uxyz->KWUV', X_aaaa, v_aaae, rdm_ccaa, optimize = einsum_type)
