# CVEA <- CAEA
def compute_sigma_vector__H1__h1_h1__CVEA_CAEA(mr_adc, X_aaaa, X_abab, X_baab, X_abba, X_baba, X_bbbb, sigma):
    cput1 = (logger.process_clock(), logger.perf_counter())

    # Einsum definition from kernel
    einsum = mr_adc.interface.einsum
    einsum_type = mr_adc.interface.einsum_type

    #Excitation Manifold
    cvea__aaaa = mr_adc.h1.cvea__aaaa
    cvea__abab = mr_adc.h1.cvea__abab
    cvea__baab = mr_adc.h1.cvea__baab
    cvea__bbbb = mr_adc.h1.cvea__bbbb
    cvea__baba = mr_adc.h1.cvea__baba
    cvea__abba = mr_adc.h1.cvea__abba 

    ## Molecular Orbitals Energies
    e_val = mr_adc.mo_energy.v
    
    ## One-electron integrals
    h_va = mr_adc.h1eff.va
    h_aa = mr_adc.h1eff.aa

    ## Two-electron integrals
    v_xxva = mr_adc.v2e.xxva
    v_vxxa = mr_adc.v2e.vxxa
    v_vaaa = mr_adc.v2e.vaaa
    v_vaee = mr_adc.v2e.vaee
    v_veea = mr_adc.v2e.veea
    v_aaaa = mr_adc.v2e.aaaa

    ## Amplitudes
    t1_va = mr_adc.t1.va
    t1_vaaa = mr_adc.t1.vaaa
    
    # Reduced Density Matrices
    rdm_ca = mr_adc.rdm.ca
    rdm_ccaa = mr_adc.rdm.ccaa
    rdm_cccaaa = mr_adc.rdm.cccaaa

    sigma_KLCW_aaaa =- einsum('KxCW,Lx->KLCW', X_aaaa, h_va, optimize = einsum_type)
    sigma_KLCW_aaaa += einsum('KxCW,L,Lx->KLCW', X_aaaa, e_val, t1_va, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxCy,Lx,Wy->KLCW', X_aaaa, h_va, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= einsum('KxCW,xy,Ly->KLCW', X_aaaa, h_aa, t1_va, optimize = einsum_type)
    sigma_KLCW_aaaa -= einsum('KxCW,Lxyz,yz->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxCW,Lyzx,zy->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxCy,LWyz,xz->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('KxCy,LWzx,yz->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxCy,LxzW,yz->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxCy,Lxzw,Wzyw->KLCW', X_aaaa, v_vaaa, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/6 * einsum('KxCy,Lzwx,Wwyz->KLCW', X_aaaa, v_vaaa, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/6 * einsum('KxCy,Lzwx,Wwzy->KLCW', X_aaaa, v_vaaa, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('KxCy,LzyW,xz->KLCW', X_aaaa, v_vaaa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/6 * einsum('KxCy,Lzyw,Wxwz->KLCW', X_aaaa, v_vaaa, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/6 * einsum('KxCy,Lzyw,Wxzw->KLCW', X_aaaa, v_vaaa, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('KxaW,LCay,xy->KLCW', X_aaaa, v_veea, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('KxaW,LyaC,xy->KLCW', X_aaaa, v_vaee, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('Kxay,LCaW,xy->KLCW', X_aaaa, v_veea, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/6 * einsum('Kxay,LCaz,Wxyz->KLCW', X_aaaa, v_veea, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/6 * einsum('Kxay,LCaz,Wxzy->KLCW', X_aaaa, v_veea, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('Kxay,LWaC,xy->KLCW', X_aaaa, v_vaee, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/6 * einsum('Kxay,LzaC,Wxyz->KLCW', X_aaaa, v_vaee, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/6 * einsum('Kxay,LzaC,Wxzy->KLCW', X_aaaa, v_vaee, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('ixCW,KiLy,xy->KLCW', X_aaaa, v_xxva, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('ixCW,LiKy,xy->KLCW', X_aaaa, v_vxxa, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/2 * einsum('ixCy,KiLW,xy->KLCW', X_aaaa, v_xxva, rdm_ca, optimize = einsum_type)
    sigma_KLCW_aaaa -= 1/6 * einsum('ixCy,KiLz,Wxyz->KLCW', X_aaaa, v_xxva, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/6 * einsum('ixCy,KiLz,Wxzy->KLCW', X_aaaa, v_xxva, rdm_ccaa, optimize = einsum_type)
    sigma_KLCW_aaaa += 1/2 * einsum('ixCy,LiKW,xy->KLCW', X_aaaa, v_vxxa, rdm_ca, optimize = einsum_type)
